const dummy_events = [
  {
    id: "e1",
    name: "party",
    decscription: "Party all night",
  },
  {
    id: "e2",
    name: "baby shower",
    decscription: "2 Baby showers",
  },
  {
    id: "e3",
    name: "Farewell",
    decscription: "Farewell for 10th std",
  },
];
const Events = () => {
  return (
    <div>
      <h2>Events page </h2>
      <ul>
        {dummy_events.map((eve)=>{
            <li>{eve.name} -</li>
        })}
      </ul>
    </div>
  );
};

export default Events;
